import React from 'react'
import Button from '@mui/material/Button';

function home() {



  
  return (
    <div>

{/* Header */}

    <header>

    <h1>Cabeça da pagina</h1>

    </header>

{/* Main */}

    <main>

    <h2>Corpo da pagina</h2>
    <p>Aqui onde vai os textos e imagens</p>

 <Button variant="contained"> Olá Mundo</Button>;



    </main>

{/* Footer */}

    <footer>

    <h2>Aqui onde fica o rodapé da pagina</h2>

    </footer>

    </div>
  )
}

export default home
